import React from "react";
import "../css/FixModal.css";
const FixModal = ({ errorData, open, setOpen }) => {
  console.log(errorData, "errorData");

  const dismissModal = (e) => {
    if (e.target.id === "fix-modal") {
      setOpen(false);
    }
  };

  if (open) {
    return (
      <div
        id="fix-modal"
        className="fix-modal"
        onClick={(e) => dismissModal(e)}
      >
        <div className="fix-modal-content">
          <p className="modal-index">3/18 errors</p>
          {errorData && errorData.map((item) => {
            return (
              <div>{item}</div>
            )
          })}
        </div>
      </div>
    );
  } else {
    return null;
  }
};

export default FixModal;
